	@Test
	public void getCityIndex(){
		String filepath = ApplicationListener.rootPath+"WEB-INF/resources/xml/stations.xml";
		File file = new File(filepath);
		try {
			if(file.exists()){
				org.dom4j.Document doc = Dom4jUtils.readXml(file);
				org.dom4j.Element root = doc.getRootElement();
				List<HashMap<String, String>> list = Dom4jUtils.getXmlNodeList(root.elements("Station"));
				int count = list.size();
				System.out.println(count);
				HashMap<String, String> map = null;
				List<String> indexList = new ArrayList<String>();
				String charS = null;
				JSONArray data = new JSONArray();
				for(int i=0;i<count;i++){
					map = list.get(i);
					map.remove("nodename");
					map.remove("nodevalue");
					map.put("stationId", "T-"+map.get("sno").toString());
					data.add(map);
					charS = map.get("ename").toUpperCase().substring(0,1);
					if(!indexList.contains(charS)){
						indexList.add(charS);
					}
				}
				System.out.println(indexList);
				Collections.sort(indexList);
				System.out.println(indexList);
				System.out.println(data);
			}else{
				System.out.println("文件不存在！"+filepath);
			}
		} catch (DocumentException e) {
			e.printStackTrace();
		}
	}
	
