	@Test
	public void testSetStationCode() throws IOException{
		String filepath = "c:/citycode.txt";
		String jsonstr = FileUtils.readFileToString(new File(filepath));
		JSONArray data = JSONArray.parseArray(jsonstr);
		System.out.println(data);
		JSONObject city = null;
		XmlConfig xml = new XmlConfig(ApplicationListener.sqlconfigFilePath);
		List<JSONObject> stations = StationUtil.getAllStation();
		System.out.println(stations);
		JSONObject station = null;
		for(int i=0;i<stations.size();i++){
			station = stations.get(i);
			System.out.println(station.getString("name"));
			for(int k=0;k<data.size();k++){
				city = data.getJSONObject(k);
				if(city.getString("city_name").contains(station.getString("name"))){
					station.put("city_code", city.getString("city_code"));
					String sql = xml.getParamConfig("setStationCityCode", station);
					System.out.println(sql);
					ApplicationListener.dao.updateObject(sql);
					break;
				}
			}
		}
	}
	
	@Test
	public void testReadCityCode() throws IOException, DocumentException, TransformerException{
		String filepath = "c:/citycode.txt";
		String jsonstr = FileUtils.readFileToString(new File(filepath));
		JSONArray data = JSONArray.parseArray(jsonstr);
		System.out.println(data);
		JSONObject city = null;
		String xmlfilepath = ApplicationListener.rootPath+"/WEB-INF/resources/xml/stations.xml";
		org.dom4j.Document doc = Dom4jUtils.readXml(new File(xmlfilepath));
		org.dom4j.Element root = doc.getRootElement();
		List<org.dom4j.Element> list = root.elements("Station");
		System.out.println(list.size());
		//List<?> dataList = Dom4jUtils.getXmlNodeList(list);
		//System.out.println(dataList);
		//HashMap<String, String> map = null;
		Element node = null;
		for(int i=0;i<list.size();i++){
			node = list.get(i);
			System.out.println(node.attributeValue("sname")+"---"+node);
			for(int k=0;k<data.size();k++){
				city = data.getJSONObject(k);
				if(city.getString("city_name").contains(node.attributeValue("sname"))){
					node.addAttribute("city_code", city.getString("city_code"));
					System.out.println(node);
					break;
				}
			}
		}
		Dom4jUtils.writeXml(doc, xmlfilepath+".xml");
	}
	
