	private void importTableCropDisease(String code,String filepath) throws DocumentException{
		System.out.println("code="+code);
		System.out.println("filepath="+filepath);
		org.dom4j.Document doc = Dom4jUtils.readXml(new File(filepath));
		org.dom4j.Element root = doc.getRootElement();
		System.out.println("root="+root);
		Element firstNode = (Element) root.elements().get(0);
		List<Element> list = firstNode.elements("list");
		System.out.println(list.size());
		Element element = null;
		String disastername = null;
		String byname = null;
		String maincrop = null;
		String othercrop = null;
		String distributing = null;
		String harm = null;
		String characters = null;
		String disciplinarian = null;
		String countermeasure = null;
		String disasterpicture = null;
		String remark = null;
		for(int i=0;i<list.size();i++){
			element = list.get(i);
			disastername = element.element("disastername").getText();
			byname = element.element("byname").getText();
			maincrop = element.element("maincrop").getText();
			othercrop = element.element("othercrop").getText();
			distributing = element.element("distributing").getText();
			harm = element.element("Harm").getText();
			characters = element.element("Characters").getText();
			disciplinarian = element.element("Disciplinarian").getText();
			countermeasure = element.element("Countermeasure").getText();
			disasterpicture = element.element("DisasterPicture").getText();
			remark = element.element("Remark").getText();
			disasterpicture = disasterpicture.replaceAll("/resource/weather/weather/nch/", "upload/bch/");
			String sql = "insert into T_CROP_DISEASE(cropcode,diseasename,byname,maincrop,othercrop,distributing,harm,characters,disciplinarian,countermeasure,disasterpicture,remark) values('"+code+"','"+disastername+"','"+byname+"','"+maincrop+"','"+othercrop+"','"+distributing+"','"+harm+"','"+characters+"','"+disciplinarian+"','"+countermeasure+"','"+disasterpicture+"','"+remark+"')";
			System.out.println(sql);
			ApplicationListener.dao.saveObject(sql);
		}
	}
	
